import React from "react";

function App() {
  return (
    <div className="min-h-screen bg-gray-50 text-gray-900 flex flex-col items-center justify-center p-12">
      <h1 className="text-4xl font-bold text-blue-600 mb-4">Welcome to ShieldEd</h1>
      <p className="text-lg text-gray-700 mb-6 text-center max-w-xl">
        Cybersecurity simulations and GDPR training built for UK schools. CPD-certified, easy to use, and highly effective.
      </p>
      <div className="flex gap-4">
        <button className="bg-blue-600 text-white px-5 py-3 rounded-lg hover:bg-blue-700 transition">Try a Simulation</button>
        <button className="bg-gray-200 text-gray-800 px-5 py-3 rounded-lg hover:bg-gray-300 transition">View Dashboard</button>
      </div>
    </div>
  );
}

export default App;
